import React, { useState } from 'react';
import axios from 'axios';

function Side_work() {
  const [userdata, setUserdata] = useState([]);

  // Function to fetch data
  const fetchData = async () => {
    try {
      const response = await axios.get('https://picsum.photos/v2/list?page=2&limit=20');
      setUserdata(response.data); // store data in state
      console.log('Fetched data:', response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className='d-flex flex-column justify-content-center align-items-center mt-5'>
      <button onClick={fetchData} className='btn btn-danger mb-3'>
        Fetch Data
      </button>

      {/* Display first 5 images as example */}
      <div className='d-flex flex-wrap justify-content-center'>
        {userdata.slice(0, 5).map((item) => (
          <div key={item.id} style={{ margin: '10px' }}>
            <img src={item.download_url} alt={item.author} width={150} />
            <p>{item.author}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Side_work;
